import React, { useState, useEffect } from "react";
import SidebarRow from './SidebarRow';
import {Avatar, IconButton} from '@material-ui/core';
import EmailIcon from '@material-ui/icons/Email';
import LocalLibraryIcon from '@material-ui/icons/LocalLibrary';
import SpeedIcon from '@material-ui/icons/Speed';
import AdminPanelSettingsIcon from '@mui/icons-material/AdminPanelSettings';
import GroupIcon from '@mui/icons-material/Group';
import PersonAddIcon from '@mui/icons-material/PersonAdd';
import DirectionsCarIcon from '@mui/icons-material/DirectionsCar';
import SupervisedUserCircleIcon from '@mui/icons-material/SupervisedUserCircle';
import FileOpenIcon from '@mui/icons-material/FileOpen';
import GroupsIcon from '@mui/icons-material/Groups';
import './Builder.css'
import AccountBalanceWalletIcon from '@mui/icons-material/AccountBalanceWallet';

function Sidebar() {

    return (
        <div className="sidebar no-print">
            <div className="logo__holder">
                <h3> Logo </h3>
            </div>

            <div className="s-divider"></div>
            <SidebarRow  Icon={SpeedIcon} title="Dashboard"/>
            <SidebarRow  Icon={GroupsIcon} title="Manage Officers"/>
            <SidebarRow  Icon={DirectionsCarIcon} title="Manage Buses"/>
            <SidebarRow  Icon={AccountBalanceWalletIcon} title="Manage Drivers"/>
            <SidebarRow Icon={PersonAddIcon} title="Payment Report"/>
            <SidebarRow  Icon={AdminPanelSettingsIcon} title="Branch"/>

            <div className="w-100 abs f-bottom">
            <div className="s-divider"></div>
               <SidebarRow  Icon={FileOpenIcon} title="Configuration"/>
                <SidebarRow Icon={LocalLibraryIcon} title="Notification" /> 
                <div className="header__info">
                    <Avatar />
                    <h4 className="title-case c-grey"> Marc Specter <br/>
                    <span className="summary__label font-9 role">Admin</span>
                    </h4> 
               </div>
            </div>


        </div>
    )
}

export default Sidebar
